import React, { useState } from 'react';
import Timer from './Timer';
import Youtube from './Youtube/Youtube.js';
import Quote from './Quotes';
import './App.css';

function App() {

  return (
    <div>
    <div className="App">

      <Timer/>
      <Youtube/>
      <Quote/>
      <text className="playlist">this is a playlist</text>
    </div>
    </div>
  )
}

export default App;
